import Navbar from './Navbar';
import Footer from './Footer';
import '../styles/PageLayout.css';

const PageLayout = ({ title, subtitle, children }) => {
  return (
    <div className="page-layout">
      {/* Container 1: Navbar */}
      <Navbar />

      {/* Container 2: Hero Section with Title */}
      <div className="container multicolor-border">
        <div className="hero-overlay">
          <img src="/images/MAVJLogo.png" alt="MAVJ Logo" className="hero-logo" />
          {title && <h1 className="hero-title">{title}</h1>}
          {subtitle && <p className="hero-subtitle">{subtitle}</p>}
        </div>
      </div>

      {/* Container 3: Logo again if needed */}
      <div className="container multicolor-border">
        <img src="/images/MAVJLogo.png" alt="Centered Logo" className="hero-logo" />
      </div>

      {/* Container 4: Intro Paragraph */}
      <div className="container multicolor-border">
        <p className="intro-paragraph">
          Welcome to My Alkaline Vegan Journey â€” a holistic health platform rooted in vibrational healing, nutrition, and global connection. Here, ancient wisdom meets modern science to guide your journey through self-realization, nourishment, and enlightenment.
        </p>
      </div>

      {/* Container 5: Content Boxes */}
      <div className="container multicolor-border">
        <div className="feature-grid">
          {children}
        </div>
      </div>

      {/* Container 6: Photo Gallery */}
      <div className="container multicolor-border">
        <h2>ðŸ“¸ MAVJ Photo Gallery</h2>
        {/* Photo components go here */}
      </div>

      {/* Container 7: Footer */}
      <Footer />
    </div>
  );
};

export default PageLayout;
